export const plus = () => {
    return {
        type:'PLUS'
    }

}

export const minus = () => {
    return {
        type:'MINUS'
    }

}

export const getRobots = () => (dispatch)=>{
    fetch(`https://jsonplaceholder.typicode.com/users`)
                    .then(response => response.json())
                    .then((response) => {
                        dispatch({
                            type:'GET',
                            payload:response
                        })

                    })
                    .catch(err => console.error(err))

}
